import React, { useState, useEffect } from "react";
import { Navbar, Nav, Container, NavDropdown } from "react-bootstrap";
import { NavLink } from "react-router-dom";
import "./Navbar.css";
import Logo from "../../assets/Consult_Hagnos_logo.png";



import { useNavigate } from 'react-router-dom';


const MyNavbar = () => {
  const [scrolled, setScrolled] = useState(false);
  const [fullScreenDropdownVisible, setFullScreenDropdownVisible] = useState(false);
  const [fullScreenDropdownVisibleResources, setFullScreenDropdownVisibleResources] = useState(false);

  const navigate = useNavigate();

  let hoverTimeout;
  let hoverTimeoutResources;


  useEffect(() => {
    const handleScroll = () => {
      if (window.scrollY > 100) {
        setScrolled(true)
      } else {
        setScrolled(false);
      }
    };

    window.addEventListener("scroll", handleScroll);

    return () => {
      window.removeEventListener("scroll", handleScroll);
    };
  }, []);

  const handleMouseEnter = () => {
    clearTimeout(hoverTimeout);
    setFullScreenDropdownVisible(true);
  };

  const handleMouseLeave = () => {
    hoverTimeout = setTimeout(() => {
      setFullScreenDropdownVisible(false);
    }, 200);
  };

  const handleMouseEnterResources = () => {
    clearTimeout(hoverTimeoutResources);
    setFullScreenDropdownVisibleResources(true);
  };

  const handleMouseLeaveResources = () => {
    hoverTimeoutResources = setTimeout(() => {
      setFullScreenDropdownVisibleResources(false);
    }, 200);
  };

  return (
    <div
      className={`w-100 ${scrolled ? "navbar-scrolled" : ""}`}
      style={{
        position: scrolled ? 'sticky' : 'relative',
        background: scrolled ? "linear-gradient(to bottom, #ffffff, #f0f0f0)" : "#FBFCFE",
        top: 0,
        zIndex: 1000,
      }}
    >
      <Navbar
        expand="xl"
        className={`container typography-p2 d-flex justify-content-center`}
      >
        <Container className="p-0 m-0">
          <Navbar.Brand as={NavLink} to="/">
            <img src={Logo} alt="Logo" className="logo" />
          </Navbar.Brand>
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="pt-3">
              <Nav.Link as={NavLink} to="/" end>
                Home
              </Nav.Link>
              <Nav.Link as={NavLink} to="/about-us">
                About Us
              </Nav.Link>

              <NavDropdown
                title="Services"
                onMouseEnter={handleMouseEnter}
                onMouseLeave={handleMouseLeave}
              >
              </NavDropdown>

              {/* <NavDropdown title="Resources" to="/resources"
                onMouseEnter={handleMouseEnterResources}
                onMouseLeave={handleMouseLeaveResources}
              >
                Resources
              </NavDropdown> */}

              <Nav.Link
                as={NavLink}
                to="/contact-us"
                style={{ marginRight: 0, paddingRight: 0 }}
              >
                Contact Us
              </Nav.Link>
            </Nav>
          </Navbar.Collapse>
        </Container>
      </Navbar>

      {fullScreenDropdownVisible && (
        <div
          className="fullscreen-dropdown"
          onMouseEnter={handleMouseEnter}
          onMouseLeave={handleMouseLeave}
          style={{
            background: '#FBFCFE'
          }}
        >
          <div className="flex justify-between items-start w-100 px-10"
            style={{
              maxWidth: '1600px'
            }}>
            <div className="dropdown-column">
              <h3 className="nav-heading" onClick={() => { navigate("/digital-services")}}>Digital Services</h3>
              <NavLink className="nav-subheading" to="/digital-services/content-management">Content Management</NavLink>
              <NavLink className="nav-subheading" to="/digital-services/graphic-designing">Graphic Designing</NavLink>
              <NavLink className="nav-subheading" to="/digital-services/digital-marketing">Digital Marketing</NavLink>

            </div>
            <div className="dropdown-column">
              <h3 className="nav-heading" onClick={() => { navigate("/consulting-services") }} >Consulting Services</h3>
              <NavLink to="/consulting-services/experience-management-and-measurement" className="nav-subheading">Experience Management & Measurement</NavLink>
              <NavLink to="/consulting-services/audit" className="nav-subheading">Audit </NavLink>
              <NavLink to="/consulting-services/automation" className="nav-subheading">Automation</NavLink>
              <NavLink to="/consulting-services/development-and-testing" className="nav-subheading">Development and Testing</NavLink>
              <NavLink to="/consulting-services/other-value-added-services" className="nav-subheading">Other Value added services</NavLink>
            </div>
            <div className="dropdown-column">
              <h3 className="nav-heading" onClick={() => { navigate("/support-services") }} >Staffing Services</h3>
              <NavLink to="/support-services" className="nav-subheading">Integrated IT & Non-IT Services</NavLink>
              <NavLink to="/support-services" className="nav-subheading">Sales & Sales Support</NavLink>
              <NavLink to="/support-services" className="nav-subheading">Operational & Administrative</NavLink>
            </div>
            <div className=" flex">
              <img className="w-[200px] h-[150px]" src={NavImg}></img>
              <div className="ms-4 w-[310px]">
                <h3 className="nav-heading">HR Technology Trends in 2024</h3>
                <div>HR technology plays a pivotal role in shaping the employee journey and driving organizational success.</div>

              </div>
            </div>
          </div>
        </div>
      )}

      {fullScreenDropdownVisibleResources && (
        <div
          className="fullscreen-dropdown"
          onMouseEnter={handleMouseEnterResources}
          onMouseLeave={handleMouseLeaveResources}
          style={{
            background: '#FBFCFE'
          }}
        >
          <div className="flex justify-evenly items-center w-100 px-10"
            style={{
              maxWidth: '1600px'
            }}>
            <div className="flex flex-col justify-center cursor-pointer" onClick={() => { navigate("/blogs") }}>
              <img className="w-[300px] h-[180px]" src={NavImg}></img>
              <div className="text-center w-[310px]">
                <h3 className="nav-heading mt-2">Blogs</h3>
              </div>
            </div>

            <div className="flex flex-col justify-center cursor-pointer" onClick={() => { navigate("/newsletter") }}>
              <img className="w-[300px] h-[180px]" src={NavImg}></img>
              <div className="text-center w-[310px]">
                <h3 className="nav-heading mt-2">Newsletter</h3>
              </div>
            </div>
          </div>
        </div>
      )}
    </div>
  );
};

export default MyNavbar;
